            (10**(token_decimals + 2));
    }

    function swapProportionately(
        uint256 WMATIC_amount,
        uint256 SAND_amount,
        uint256 WETH_amount,
        uint256 WBTC_amount,
        uint256 totalUSDAmount,
        uint256 depositAmount
    ) public {
        uint256 WMATIC_share = (WMATIC_amount * (depositAmount)) /
            (totalUSDAmount);
        uint256 SAND_share = (SAND_amount * (depositAmount)) / (totalUSDAmount);
        uint256 WETH_share = (WETH_amount * (depositAmount)) / (totalUSDAmount);
        uint256 WBTC_share = (WBTC_amount * (depositAmount)) / (totalUSDAmount);

        swap(
            WMATIC_share,
            uint256(0),
            USDCToWMATICPath,
            address(this),
            99999999999
        );
        swap(
            SAND_share,
            uint256(0),
            USDCToSANDPath,
            address(this),
            99999999999
        );
        swap(
            WETH_share,
            uint256(0),
            USDCToWETHPath,
            address(this),
            99999999999
        );
        swap(
            WBTC_share,
            uint256(0),
            USDCToWBTCPath,
            address(this),
            99999999999
        );
    }

